using Dates

function event_scheduler(events)
    if isempty(events)
        return "No events"
    end

    for (i, e1) in enumerate(events)
        for (j, e2) in enumerate(events[i+1:end])
            if overlap(e1, e2)
                return "Conflict"
            end
        end
    end

    return "No conflicts"
end
